import React, { useEffect } from "react";
import Aos from "aos";
import "aos/dist/aos.css";

import Spline from '@splinetool/react-spline';

import { Container, Row, Col } from "react-bootstrap";
import Home2 from "./Home2";
import Type from "./Type";

function Home() {

  useEffect(() => {
   Aos.init({duration: 2000});
  }, []);

  return (
    <section>
      <Container fluid className="home-section" id="home" data-aos="fade-down">
        <Container className="home-content">
          <Row>
          <Col md={13} style={{ paddingBottom: 20, display: 'flex', alignItems: 'center' }}>
           <Spline className="img-fluid logo-home" scene="https://draft.spline.design/ownAVKTnQWzvb-rS/scene.spline" />
            </Col>
          </Row>
        </Container>
      </Container>
      <Home2 />
    </section>
  );
}

export default Home;
